INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Non praesentium vitae voluptas impedit deserunt tempore excepturi.', 'Harum quaerat voluptates aspernatur explicabo earum. Dolorem neque iste et quisquam. Commodi in aliquid et iure repellat. Quia laboriosam consequatur fugiat est.', 'Consectetur nobis consectetur rerum qui consequuntur quis. In labore ea tenetur minima. Aliquid eligendi reprehenderit voluptate amet suscipit ipsa accusamus quam.', '1997-09-29');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Aliquam itaque laborum exercitationem porro nam.', 'Cupiditate blanditiis neque ad recusandae. Quisquam et sunt nulla tenetur nobis. Dolorem labore sint corrupti eum sed.', 'Et et fugiat voluptatem ipsam cupiditate rerum. Quisquam beatae qui nostrum sunt. Temporibus harum accusantium officiis occaecati consequatur. Aut et neque ea iure odio tempore eaque aut.', '1991-10-25');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Facilis minus soluta repellendus architecto perferendis.', 'Dolorem iure qui recusandae sed sit. Exercitationem non itaque autem voluptatem. Quam voluptas vel quisquam excepturi et quia reprehenderit. Omnis quis repudiandae rerum iure ea porro quo.', 'Porro amet eveniet qui debitis aspernatur voluptas. Aliquid beatae ipsa necessitatibus eum earum ab. Quasi et eligendi amet in et.', '1983-01-19');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Odit et placeat laudantium incidunt voluptas quidem voluptatem.', 'Possimus quasi laborum enim consequatur amet minima eaque. Eum provident voluptatem voluptas sint sapiente quis. Sed velit quo alias pariatur est est.', 'Consequuntur maiores nobis consequuntur magnam. Nemo autem aut vel sed animi.', '2008-04-14');
